import React from "react";

function Card() {
    return (
        <div className="card">
            <div className="card-header">
                <h3 className="card-title">Card 1</h3>
            </div>
            <div className="card-header">
                <h3 className="card-title">Card 2</h3>
            </div>
            <div className="card-body">
                <p className="card-text">
                </p>
            </div>
        </div>

    );
}
export default Card;
